def solve():
    s = "t5 t5 t0"

    def generate(string, t_set):
        if not string:
            return True
        for char in t_set:
            if string.startswith(char):
                if generate(string[len(char):], t_set):
                    return True
        return False

    if generate(s, {1, 2, 3, 4, 5, 6, 7, 8, 9}):
        print("Yes")
    else:
        print("No")

solve()
